INSERT INTO `incidencia_importacion` VALUES (1,'2025-10-03 10:44:08',1,NULL,'EN EL DESPACHO ZEUS35, EN EL ITEM 16 Y 17 , HAY UN ERROR EN LAS CANTIDADES POR CAJA:\nDEBE SER :\n16	Protector Facial Ajustable	PZ-SFS01	40 UNIDADES POR CAJA \n17	   Visor Facial	                 PZ-SFS03	100 UNIDADES POR CAJA\n\nSE INDICAR REVISAR CON URGENCIA, PARA CONTINUAR CON ELPROCESO \n JEFE DE AREA \nJOSEPH           \n ','2025-10-03','COMPLETADO',NULL,'HERVIN','CONCLUIDO'),(2,'2025-10-03 12:01:16',2,NULL,'DE ACUERDO A LA IMPORTACION ZEUS36 SE ENCONTRO LO SIGUIENTE: \n\n1- EL ITEM 8 NO FUE ENVIADO POR EL PROVEEDOR \n2- EL ITEM DE LA SERIE 001 Y 002 NO FIGURABA EN PACKING ORIGINAL \n\nTAMBIEN SE INDICA QUE LOS ITEMS 1, 2, 3, 4 ,7, 11 Y 14, TIENEN COMO INCIDENCIA FALTANTES Y SOBRANTES.\n\nPOR FAVOR SE SOLICITA LA REVISION \n\nJEFE DE LOGISTICA - JOSEPH ','2025-10-23','COMPLETADO',NULL,'KIMBERLY','CONCLUIDO'),(4,'2025-10-06 09:27:28',4,NULL,'DE ACUERDO A LA IMPORTACION ZEUS37/ZEUS38 SE ENCONTRO LO SIGUIENTE:  \n\nSE INDICA QUE LOS ITEMS 1, 2, 3, 4 ,8, 9 Y 10, TIENEN COMO INCIDENCIA FALTANTES Y SOBRANTES.\n\nPOR FAVOR SE SOLICITA LA REVISION DE ESTA IMPORTACION.\n\nJEFE DE LOGISTICA - JOSEPH ','2025-10-23','COMPLETADO',NULL,'KIMBERLY','CONCLUIDO'),(5,'2025-10-06 11:00:22',3,NULL,'DE ACUERDO A LA IMPORTACION ZEUS39 SE ENCONTRO LO SIGUIENTE: \n\n1- EL ITEM 5 DEBIO LLEGAR EN TOTAL 2500 UNIDADES EN ESE PRODUCTO / 250 UNIDADES POR CAJA\n\n   PERO AL SER REVISADO POR LOGISTICA, SOLO SE CONTABILIZO 2472 UNIDADES - ERROR DE ORIGEN.\n\n   NOTA: EL CONTEO FISICO DE ESE ITEM FUE REALIZADO POR LA COLABORADORA JOSELYN Y EL COLABORADOR MANUEL.\n\n   POR FAVOR SE SOLICITA LA REVISION \n\n   JEFE DE LOGISTICA - JOSEPH ','2025-10-23','COMPLETADO',NULL,'KIMBERLY','CONCLUIDO'),(6,'2025-10-06 11:19:43',8,NULL,'DE ACUERDO A LA IMPORTACION ZEUS44 SE ENCONTRO LO SIGUIENTE: \n\n1- EL ITEM 6 Y 9 NO FUE ENVIADO POR EL PROVEEDOR \n2- EL ITEM DE LA SERIE 001 Y 002 NO FIGURABA EN PACKING ORIGINAL - NUEVOS ITEMS INGRESADOS \n\nTAMBIEN SE INDICA QUE LOS ITEMS 2 Y 10 TIENEN COMO INCIDENCIA FALTANTES.\n\nNOTA : SE DETALLA QUE LA CANTIDAD DE CAJAS INGRESADAS DEL CONTENEDOR SON 1248, TAL CUAL EL PACKING ENVIADO DEL DESPACHO ZEUS44.\n\nPOR FAVOR SE SOLICITA LA REVISION \n\nJEFE DE LOGISTICA - JOSEPH ','2025-10-23','COMPLETADO',NULL,'KIMBERLY','CONCLUIDO'),(7,'2025-10-27 18:48:33',9,NULL,'DE ACUERDO A LA IMPORTACION ZEUS45 SE ENCONTRO LO SIGUIENTE: \n\n1- EL ITEM 7 Y 10 NO FUE ENVIADO POR EL PROVEEDOR \n2- EL ITEM DE LA SERIE 001 Y 002 NO FIGURABA EN PACKING ORIGINAL / NUEVOS ITEMS\n\nTAMBIEN SE INDICA QUE LOS ITEMS 1, 2, 3, 4 ,5, 8 Y 11, TIENEN COMO INCIDENCIA FALTANTES Y SOBRANTES.\n\nPOR FAVOR SE SOLICITA LA REVISION \n\nNOTA : EN ESTE DESPACHO INGRESO 1200 CAJAS, TAL CUAL LA CANTIDAD INICIAL TOTAL DEL DESPACHO ZEUS45.\n\nJEFE DE LOGISTICA - JOSEPH ','2025-10-28','COMPLETADO',NULL,'KIMBERLY','CONCLUIDO'),(8,'2025-10-29 21:22:35',7,NULL,'DE ACUERDO A LA IMPORTACION ZEUS42/ZEUS43/ZEUS49 SE ENCONTRO LO SIGUIENTE: \n \n1.  SE INDICA QUE LOS ITEMS  3 y 4 TIENEN COMO INCIDENCIA FALTANTES Y SOBRANTES.\n\nPOR FAVOR SE SOLICITA LA REVISION \n\nNOTA : EN ESTE DESPACHO INGRESO 452 CAJAS, TAL CUAL LA CANTIDAD INICIAL DEL DESPACHO ZEUS42/ZEUS43/ZEUS49.\n\nJEFE DE LOGISTICA - JOSEPH ','2025-10-30','REVISADO',NULL,'KIMBERLY','NO CONCLUIDO');
