INSERT INTO `reprogramaciones` VALUES (6,34,'2025-10-25 15:00:00','Buenos dias estimado Alvaro , se envia respuesta a su solicitud \r\n para tres modelos nuevos.\r\n\r\nFlexiBlue:  S/ 4.50 – S/ 5.50. Precio para mercado  de malvinas\r\n\r\nThermoPlus:  S/ 8.00 – S/ 9.00. Precio para mercado  de malvinas\r\n\r\nUltraBlue: en investigación dicho producto no ingresa a almacen \r\n\r\nnota: se solcita enviar un informe sobre la aceptacion de los precios, para pasar a un analisis de disminucion o incremento','2025-11-04 11:10:46',NULL,NULL),(7,40,'2025-11-08 10:56:00','Buenos días estimado Joseph, se reprograma la entrega de los materiales, debido a que no se cuenta con stock de los materiales solicitados, se realizara la compra para poder hacer la entrega.','2025-11-04 09:58:09',NULL,NULL),(8,57,'2025-11-07 12:24:00','Buenos tardes, se envia la notificacion , indicar a pedro para que pueda imprimir y entregar ',NULL,'https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/ZS-GG-NOT- FAC2025-01 SANDRA.pdf',NULL);
