INSERT INTO `respuestas` VALUES (14,56,'2025-10-09 14:38:49','HERVIN','Buenas tardes estimada Evelyn, para el dia 10/10/2025, se realizara la devolucion\r\nsaludos.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Devolucion MK-01.pdf','Completado'),(15,57,'2025-10-09 17:09:26','EVELYN','Buenas tardes srta kimberly solicitud recibida ; para el día 10/10/25 en el transcurso del día se visualizará lo solicitado.\r\n\r\nBuenas tardes Srta. Kimberly . Se esta adjuntado lo solicitado.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/guantes.pdf','Completado'),(16,58,'2025-10-09 18:01:50','HERVIN','Buenas tardes estimada Kimberly, su solicitud fue atendida \r\nsaludos.',NULL,'Completado'),(17,59,'2025-10-10 17:11:58','EVELYN','Buenas tardes joven Se envió los PDF del Respirador z7502 , pero no se envió el repuesto KN95 ya que en el archivo no me permite ingresar mas documentos y es por eso que se le envió en el grupo de Diseños de Importación ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/RESPIRADOR Z7502.pdf','Completado'),(19,62,'2025-10-11 10:12:47','KIMBERLY','Buenos días estimado Alvaro, se envía el archivo con las fotos referenciales de la competencia y descripción de los productos. Con respecto las manos de PVC es un producto que no será para la venta a los clientes, son manos de PVC para exhibición de los guantes.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/NUEVOS MODELOS .pdf','Completado'),(20,66,'2025-10-13 00:06:08','KIMBERLY','Buenas tardes estimada Evelyn, se le envía la respuesta a su solicitud.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/RESPUESTA DE ACTIVIDAD DE HALLOWEEN.pdf','Completado'),(21,74,'2025-10-13 11:33:58','HERVIN','Buenos dias estimada Kimberly,\r\nse adjunta nueva notificacion, a la espera de su respuesta para continuarel proceso .','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/NOTIFICACCION ZS-2025-0148-KA.pdf','Completado'),(22,60,'2025-10-13 11:34:10','EVELYN','Buenas noches estimada Kimberly. Le comento que los diseños ya están realizados con lo solicitado; el detalle de envió por este medio no me permite subir la carpeta completa con todos los diseño es por esa razón mientras se soluciona estaré enviando por el GRUPO DE DISEÑOS DE IMPORTACIONES. Cualquier consulta me escribe.  ',NULL,'Completado'),(23,75,'2025-10-13 12:23:50','HERVIN','Bunas tardes estimado joseph,\r\nsu solicitud fue atendida de menra prersencial conjuntamente con su persona .',NULL,'Completado'),(25,102,'2025-10-16 12:03:33','EVELYN','error de envio destinado',NULL,'Completado'),(26,103,'2025-10-16 12:04:26','EVELYN','Buenas tardes srta kimberly solicitud recibida ; para el día de hoy 16/10/25 en el transcurso del día se visualizará lo solicitado.\r\n\r\nSolicitud completado',NULL,'Completado'),(27,104,'2025-10-16 12:04:38','','Buenas tardes srta kimberly solicitud recibida ; para el día de hoy 16/10/25 en el transcurso del día se visualizará lo solicitado.',NULL,'Completado'),(28,105,'2025-10-16 20:15:49','HERVIN','Buenas noches estimada Evelyn, \r\nSe ha respondido su informe .\r\n fecha de respuesta 23/10/2025 12.16 pm','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/RESPUESTA DE INFORME MARKETING 23.pdf','Completado'),(29,76,'2025-10-16 20:16:34','HERVIN','Buenas noches estimado joseph, en proceso de Evaluacion ',NULL,'En Revisión'),(34,112,'2025-10-22 06:43:45','HERVIN','Buenas días estimado ALvaro, \r\nLa información ha sido recibido, se procede a revisar y dar respuesta. ',NULL,'Completado'),(35,114,'2025-10-22 16:39:28','KIMBERLY','Buenas tardes estimada Evelyn, la informacion esta confirmada, se le solicita modificar lo siguiente:\r\nAlmuerzo de 12:30pm a 1:30pm\r\nMaquillaje de 1:30pm a 2:20pm\r\nTolerancia: 10 minutos\r\nInicio de la dinamica: 2:30 pm \r\n\r\nAdicional a ello se le pide enviar los comunicados del cronograma para que los trabajadores sepan como será  las actividades de ese día, de igual manera de enviar los nombres de las personas que no van a participar para poder designarles sus actividades de manera normal.',NULL,'Completado'),(36,123,'2025-10-22 18:20:58','KIMBERLY','Buenas tardes estimada Evelyn, se reviso la campaña y la lista de clientes, se enviara un comunicado con el ultimo filtro para los clientes de Malvinas. ',NULL,'En Proceso'),(37,125,'2025-10-23 16:50:14','ALVARO','Buenas tardes, información recibida. Mi persona el día de mañana estará ausente como se indico hace una semana, por favor se le solicita brindar el chip a José, por qué el día sábado inicio actividades en SJM y tengo que salir 7:00 am.',NULL,'Completado'),(38,130,'2025-10-25 10:19:53','EVELYN','Buenos días joven se esta enviando los diseños para el correo electrónico por favor me confirma si hay modificaciones ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/CORREOS.pdf','Completado'),(39,127,'2025-10-28 17:48:12','ALVARO','Buenas tardes, se adjunta informe ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Reprogramaciones.pdf','Completado'),(40,124,'2025-10-30 09:18:06','KIMBERLY','Buenos dias estimado Joseph, para el dia 3 de noviembre se le hara la entrega de los materiales que esta solicitando.',NULL,'En Proceso'),(41,132,'2025-10-30 10:32:31','JOSEPH','BUENOS DIAS ESTIMADA KIMBERLY, SE LE HARA LA ENTREGA DE LOS NUEVOS PRODUCTOS QUE SOLICITA, TALES COMO:\r\n\r\n- TERMOPLUS\r\n- NITRON ABIERTO \r\n- NITRON CERRADO \r\n- FLEXIBLUE AZUL',NULL,'Completado'),(43,141,'2025-11-03 11:00:20','JOSEPH','BUENOS DIAS ESTIMADO CRISTELL, SE LE HARA LA ENTREGA DE LOS NUEVOS PRODUCTOS QUE SOLICITO, TALES COMO:\r\n\r\n- THERMOPLUS\r\n- NITRON ABIERTO\r\n- NITRON CERRADO\r\n- FLEXIBLUE AZUL\r\n\r\nNOTA: SE LE HIZO ENTREGA DE LOS PRODUCTOS SOLICITADOS AL COLABORADOR SEBASTIAN .',NULL,'Completado'),(44,153,'2025-11-03 15:52:06','EVELYN','Buenas tardes srta kimberly \r\n1. Se esta enviando el reporte de la srta dayana . Cualquier consulta me detallan gracias.\r\n2. Los flyer se estarán enviando el dia de hoy de los nuevos productos para el grupo de fotos\r\n3. sobre mis horarios le estaré enviando según me lo indican','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/INFORME DE EVALUACIÓN DEL PERÍODO DE PRUEBA DAYANA.pdf','Completado'),(45,144,'2025-11-03 18:23:44','EVELYN','Buenas tardes joven hervin , le envió mi respuesta de su información sobre incumplimientos , la cual le respondí para evitar inconvenientes porque hay puntos que si comparto como en otros puntos no. \r\n\r\nadjunto tambien el informe de la srta dayana ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Administracion.zip','Completado'),(46,126,'2025-11-04 09:48:17','KIMBERLY','Buenas tardes estimado Joseph, se esta evaluando las condiciones de la información que envió, debido que los demás trabajadores no presentan el mismo inconveniente que el trabajador Víctor, se le estará brindando respuesta final el 10 de noviembre del 2025 a las 5:30pm.\r\n************************************************************************\r\nBuenas tardes estimado Joseph, se concluye con lo solicitado por favor de revisar el archivo adjunto.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/RESPUESTA - CALZADO VICTOR.pdf','Completado'),(47,143,'2025-11-04 09:49:34','KIMBERLY','Buenos días estimada Evelyn, el encargado de brindar los precios de los nuevos productos es el jefe de área de ventas, se le solicita hacer llegar su solicitud al área que corresponde.',NULL,'Completado'),(48,149,'2025-11-04 09:50:37','KIMBERLY','Buenos días estimado Joseph, se le pide enviar las evidencias para poder realizar el cambio que esta solicitando.',NULL,'En Proceso'),(49,150,'2025-11-04 09:55:35','KIMBERLY','Buenos días estimado Joseph, para las siguientes solicitudes o información que envía, se le solicita enviar información detallada como el día que se descargo, en que descarga fue, toda información que se necesita para poder saber la cronología de la que esta enviando.\r\nCon respecto al foco roto se estará haciendo la reposición el día sábado 8 de noviembre a las 5:30pm',NULL,'En Proceso'),(50,155,'2025-11-04 15:11:59','ALVARO','Buenas tardes, ya se realizó la solicitud ',NULL,'Completado'),(51,157,'2025-11-04 15:13:27','ALVARO','Buenas tardes, ya se solicito los precios de los productos solicitados, está a la espera.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/IMG-20251106-WA0024.jpg','Completado'),(52,180,'2025-11-04 16:26:35','JOSEPH','BUENAS TARDES ESTIMADA, SE LE ESTARA ENTREGANDO SUS MUESTRAS EL DIA DE HOY 04/11 AL COLABORADOR MANUEL. INFORMACION RECIBIDO\r\n\r\nPRODUCTOS \r\n- THERMOPLUS\r\n- FLEXIBLUE AZUL\r\n- NITRON ABIERTO \r\n- NITRON CERRADO',NULL,'Completado'),(53,182,'2025-11-04 16:58:28','JOSEPH','BUENAS TARDES ALVARO, SE ALISTA LO MENCIONADO PARA USTED Y SU EQUIPO.\r\n\r\nPOR FAVOR MENCIONAR EL DIA DE ENTREGA, LO TENDRE LISTO CON ANTICIPACION. \r\nENTREGA DIA VIERNES ( COORDINADO CON EL ASESOR )',NULL,'Completado'),(54,183,'2025-11-04 21:20:04','HERVIN','Buenas noches estimado Alvaro, los precios se mantienen.\r\n',NULL,'Completado'),(55,181,'2025-11-04 21:22:34','HERVIN','Buenos dias estimado Alvaro , se reenvía el mensaje. respuesta a su solicitud para tres modelos nuevos. FlexiBlue: S/ 4.50 – S/ 5.50. Precio para mercado de malvinas ThermoPlus: S/ 8.00 – S/ 9.00. Precio para mercado de malvinas UltraBlue: en investigación dicho producto no ingresa a almacen nota: se solcita enviar un informe sobre la aceptacion de los precios, para pasar a un analisis de disminucion o incremento\r\n\r\n🕒 Última actualización del motivo: 04/11/2025, 11:10:46 a. m.',NULL,'Completado'),(56,184,'2025-11-05 15:15:36','JOSEPH','Buenas tardes estimada kimberly, se trajo lo solicitado, con respecto al film y la cinta. ya se encuentra en el primer piso de oficina...',NULL,'Completado'),(57,185,'2025-11-05 21:05:40','HERVIN','Buenas noches estimada kimberly\r\nSe ha recepcionado su solicitud, se procede a abrir una notificaron, al final del proceso y/o si se requiere más información, se le estará informando .',NULL,'Completado'),(58,187,'2025-11-07 09:14:29','HERVIN','Buenos dias estimado joseph, \r\npara el dia lunes se dejara operativo la impresora ',NULL,'En Proceso'),(59,189,'2025-11-07 10:03:16','JOSEPH','Buenos días estimado, se le estará informando y enviando durante el día al colaborador Victor sobre el usuario y contraseña mencionado ',NULL,'Completado'),(60,186,'2025-11-07 12:37:56','ALVARO','Buenas tardes, ya se cuenta con un grupo de pedidos programados, crear un grupo independiente no creo que se la solución por qué en efecto los que conformamos el grupo de programados o anulados somos todos los asesores de ventas y los que más tienen inconvenientes con eso somos los que trabajamos en campo (ferreteria) para no tener estos inconvenientes se le menciono a administración que íbamos a tener estos inconvenientes, pero se sugiere mantener el grupo que se tiene, pero mejorando en el tema de comunicación.\r\nEjemplo : enlazar el pedido el cual no fue aceptado por distintos motivos e indicar a logística que queda pendiente fecha por reprogramar, anular o llevar.\r\nEsto no se vino asiendo y es la raíz del problema.',NULL,'Completado'),(61,190,'2025-11-07 13:46:09','KIMBERLY','Buenas tardes estimado Álvaro, se verifico el numero de factura 9906 y el monto es de s/316.00, pero no hay mayor información, por favor de adjuntar la siguiente información en una nueva solicitud:\r\nNumero de cuenta del cliente para hacer la devolución\r\nNombre de la empresa o persona a realizar la transferencia.\r\n\r\nDespués de enviar toda la información, la transferencia se estará realizando en un plazo de 24 horas, por favor de informar al cliente que brinde sus datos para proceder con la devolución.',NULL,'Completado'),(62,192,'2025-11-07 18:09:03','JOSEPH','Buenas tardes estimado, ya se realizó lo solicitado ',NULL,'Completado'),(63,191,'2025-11-08 11:00:35','KIMBERLY','',NULL,'En Proceso'),(64,188,'2025-11-08 11:39:34','EVELYN','Buenos días joven , información recibida ',NULL,'Completado');
