INSERT INTO `solicitudes_backup` VALUES (56,'2025-10-09 12:07:23','EVELYN','MK_01','MARKETING','','Buenos días estimados por favor se le esta enviando un PDF detallando para una devolución para un cliente de ONLINE. \r\n\r\nQuedo a la espera de su respuesta. Gracias','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Informe_Requerimiento_Devolucion_Liz_Angélica_Rosales_Julcarima (1).pdf','ADMINISTRACION','Completado',1),(57,'2025-10-09 17:03:48','KIMBERLY','ADMIN_01','ADMINISTRACION','','Buenas tardes estimada Evelyn, se solicita ingresar un nuevo código al sistema de facturación, dicho código es GZ-N410-9 con el nombre THERMO-PLUS CELESTE 9, lo cual se encuentra en el ítem 11 del despacho ZEUS46, adicional a ello se le solicita subir conjuntamente la foto del producto en el sistema, a la espera de su pronta respuesta.',NULL,'MARKETING','Completado',1),(58,'2025-10-09 17:56:37','KIMBERLY','IMP_02','IMPORTACION','','Buenas tardes estimado Hervin, se le solicita ingresar al sistema el nuevo producto con código GZ-A60-9 con nombre ULTRABLUE AZUL 9, a la espera de su respuesta.',NULL,'ADMINISTRACION','Completado',1),(59,'2025-10-10 11:13:57','HERVIN','ADMIN_02','ADMINISTRACION','','Buenos dias estimada Evelyn, solicito de manera urgente los diseños, de acuerdo a los productos mencionados en la conversacion  de hoy  con fecha 10/10/2025. \r\n1: dice 3701 cotton filters\r\nCodigo FZ-3701\r\n2: Debe ser :\r\n Nombre: 5N11 PRE FILTERS\r\nCodigo: FZ-5N11.\r\n3: tanbien se indico , que en el despacho va venir solo el respirador 7502 sin filtro, por ello se necesita una pegatina .\r\nNombre: FACE MASK \r\nCodigo: Z7502\r\n',NULL,'MARKETING','Completado',1),(60,'2025-10-10 14:14:00','KIMBERLY','IMP_03','IMPORTACION','','Buenas tardes estimada Evelyn, se le solicita los diseños de los guantes:\r\nDiseño de caja\r\nDiseño de logo\r\nDiseño de Headcard\r\nEl objetivo es diferenciar este lote de guantes, ya que es de un nuevo proveedor. Dentro del archivo se coloca toda la información de los productos, por favor de hacer los diseños con la información proporcionada y enviarlo para el día martes 14 de octubre a las 10:00am ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/DISEÑOS DE GUANTES .pdf','MARKETING','Completado',1),(62,'2025-10-10 18:11:28','ALVARO','VEN_01','VENTAS','','Buenas tardes, se solicita información e imágenes de los siguientes productos para el respectivo estudio de mercado:\r\n* FLEXIBLUE\r\n* TERMOPLUS\r\n* MANOS PVC',NULL,'ADMINISTRACION','Completado',1),(66,'2025-10-11 10:49:46','EVELYN','MK_02','MARKETING','','Buenos dias estimados se esta enviado la planificación y el cronograma que se esta realizando para este evento por Halloween y la canción criolla. \r\n\r\nQuedo a la espera de su respuesta ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Informe Marketing Halloween 2025 ZEUS.pdf','ADMINISTRACION','Completado',1),(74,'2025-10-13 09:45:31','KIMBERLY','ADMIN_03','ADMINISTRACION','JOSELYN','Buenos días estimado Hervin, le estoy enviando un archivo informando de la incidencia de la trabajadora Joselyn.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/INFORME DE INCIDENCIA - JOSELYN.pdf','GERENCIA','Completado',1),(75,'2025-10-13 10:25:56','JOSEPH','LOG_02','LOGISTICA','','BUENOS DIAS ESTIMADO, SE LE INFORMA QUE DESDE EL DIA SABADO 11/10 NO HAY INTERNET EN MI OFICINA ( LOGISTICA ), ESPERO UNA REVISION POR FAVOR.\r\n\r\nNOTA: SE ESTA AVANZANDO CON LOS DATOS DEL CELULAR DE LA EMPRESA, PERO EL USO COMPARTIDO SE SALE A CADA MOMENTO. \r\n\r\nBUEN DIA, GRACIAS ',NULL,'ADMINISTRACION','Completado',1),(76,'2025-10-13 12:52:03','JOSEPH','LOG_03','LOGISTICA','','BUENAS TARDES ESTIMADO HERVIN, SE LE SOLICITA PODER DETALLARME LAS CANTIDADES QUE SE LE VA A SEPARAR A LA SEÑORA LUZ, CUANDO LOS ITEMS QUE ME MENCIONE, ESTE EN BAJO STOCK.\r\n\r\n   PRODUCTOS QUE A MENUDO SOLICITA EL CLIENTE:\r\n\r\n- PUFLEX ( TALLAS EN COLOR PLOMO Y NEGRO )\r\n- FORTFLEX NARANJA T8 Y T9\r\n- ECONOFLEX ROJO T8 Y T9\r\n- BADANA BLANCO T9\r\n- RESPIRADORES \r\n- IMPERMEABLE \r\n- AGREGAR OTROS ITEMS QUE CREE CONVENIENTE.\r\n\r\n\r\nNOTA : CON RESPECTO A LAS CANTIDADES QUE ME MENCIONE, VA DEPENDER A MI CRITERIO PODER SEPARAR O NO.\r\nPOR EJEMPLO, EN CUANTO A LA LLEGADA DE OTROS DESPACHOS Y ESTE EL PRODUCTO EN BAJO STOCK, NO SE SEPARARA LO MENCIONADO Y SALDRA A LA VENTA.\r\n\r\nCUALQUIER COSA ME INFORMA SOBRE LO SOLICITADO, BUEN DIA \r\n\r\nATTE : AREA LOGISTICA.',NULL,'ADMINISTRACION','En Revisión',1),(102,'2025-10-15 15:52:09','EVELYN','MK_03','MARKETING','','Buenas tardes joven Hervin , le envió el informe de la Campaña del mes de Septiembre y Octubre 2025. Quedo a la espera de su respuesta para proceder las campañas navideñas.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/INFORME DE CAMPAÑA ZEUS SAFETY Y ZEUS ELECTRIC SEPTIEMBRE Y OCTUBRE.pdf','MARKETING','Completado',1),(103,'2025-10-16 10:51:59','KIMBERLY','IMP_06','IMPORTACION','','Buenas tardes estimada Evelyn, se solicita ingresar un nuevo código al sistema de facturación, dicho código es GZ-PVC30-9 con el nombre FLEXIBLUE AZUL 9, lo cual se encuentra en el ítem 3 del despacho ZEUS43, adicional a ello se le solicita subir conjuntamente la foto del producto en el sistema, a la espera de su pronta respuesta.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/FOTO FLEXIBLUE.pdf','MARKETING','Completado',1),(104,'2025-10-16 10:57:20','KIMBERLY','IMP_08','IMPORTACION','','Buenas tardes estimada Evelyn, se solicita ingresar un nuevo código al sistema de facturación, dicho código es GZ-A60-9 con el nombre ULTRABLUE AZUL 9, lo cual se encuentra en el ítem 8 del despacho ZEUS47, adicional a ello se le solicita subir conjuntamente la foto del producto en el sistema, a la espera de su pronta respuesta.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/FOTO ULTRABLUE.pdf','MARKETING','Completado',1),(105,'2025-10-16 12:02:54','EVELYN','MK_04','MARKETING','','Buenas tardes joven Hervin , le envió el informe de la Campaña del mes de Septiembre y Octubre 2025. Quedo a la espera de su respuesta para proceder las campañas.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/INFORME DE CAMPAÑA ZEUS SAFETY Y ZEUS ELECTRIC SEPTIEMBRE Y OCTUBRE.pdf','ADMINISTRACION','Completado',1),(112,'2025-10-16 22:01:08','ALVARO','VEN_02','VENTAS','','Buenas noches, adjunto los precios de los productos próximos a ingresar','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/INFORME DE PRECIOS DE PRODUCTOS NUEVOS.pdf','ADMINISTRACION','En Proceso',1),(113,'2025-10-17 09:54:20','KIMBERLY','ADMIN_04','ADMINISTRACION','','Buenos días estimado Álvaro, se le envía el recordatorio de sus vacaciones.','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/ASUNTO - VACACIONES ALVARO .pdf','VENTAS','Pendiente',1),(114,'2025-10-20 07:58:39','EVELYN','MK_05','MARKETING','','Buenos dias estimados se esta enviado la planificación y el cronograma del desarrollo para este evento por Halloween y la canción criolla. SE esta adjuntando los puntos que me indicaron , Sobre el compartir se realizo una votación y salio elegido Choripán. ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Informe Marketing Halloween 2025 ZEUS - parte 2 .pdf','ADMINISTRACION','Completado',1),(123,'2025-10-21 16:42:59','EVELYN','MK_06','MARKETING','','Buenas tardes Srta kimberly se envia el informe de la campaña con los puntos que quedaron en confirmación:\r\n* Categorías de Canastas (montos)\r\n* Productos adicionales para los clientes\r\n* Obsequio al mejor trabajador\r\nSe esta adjuntando también la lista de los clientes y también las encuentas (se realizo 2 tipos de encuentas) .Por favor cualquier observación me indica y si habrá alguna reunión para afinar algunos puntos. \r\n','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/campañas navideña zeus 2025.zip','ADMINISTRACION','En Revisión',1),(124,'2025-10-23 12:33:53','JOSEPH','LOG_04','LOGISTICA','','Se requiere lo siguiente:\r\n1 . Se solicita los siguientes materiales para el área de logística.\r\n 2 . Productos de merchandising. ','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/Solicitud_Logistica ZEUS.pdf','ADMINISTRACION','En Proceso',1),(125,'2025-10-23 14:06:36','KIMBERLY','ADMIN_05','ADMINISTRACION','','Buenas tardes estimado Álvaro, por favor se solicita a su equipo de trabajo iniciar sus actividades el día de mañana viernes 24 de octubre a las 9:00am en oficina. El motivo es para la entrega de los chip de su celular, ya que se hizo el cambio de operador de todas las líneas de la empresa.',NULL,'VENTAS','Completado',1),(126,'2025-10-23 14:45:09','JOSEPH','LOG_05','LOGISTICA','','Solicitud de implemento de seguridad - Victor','https://storage.googleapis.com/archivos_sistema/incidencias_areas_zeus/SOLICTUD DE RENOVACION DE PRENDAS - VICTOR.pdf','ADMINISTRACION','Pendiente',1),(127,'2025-10-24 18:04:09','KIMBERLY','ADMIN_06','ADMINISTRACION','','Buenas tardes estimado Álvaro se va visualizado en los últimos días en el grupo de *PEDIDOS PROGRAMADOS O CANCELADOS* que hay varios motivos que no tienen dinero y que se encuentra cerrado, y los asesores de venta en automático mandan a anular ese comprobante.\r\nEl día de hoy hubo 4 proformas y el día de ayer 2 proformas en ese estado con valores considerables, creemos que no es el proceso adecuado de solo mandar a anular el comprobante y perder la venta.\r\nSe indica los puntos que se cree probable para que suceda esa situación: \r\n1.- el asesor no indica de manera clara al cliente el día de la entrega del producto y no deja la copia de la hoja al cliente.\r\n2.- el operador logístico no llega a tiempo para realizar la entrega.\r\n3.- el cliente tiene imprevistos para la recepción de los pedidos.\r\nSe les solicita llamar al cliente y corroborar la información y si fuera el caso de reprogramar una nueva fecha, con una semana después para la entrega.\r\nUsted debe de coordinar un día antes que un asesor de venta regrese a es distrito donde se esta reprogramando las entregas para sacar mas proformas y poder gestionar las entregas de manera correcta, sin afectar los temas de gastos de transporte.\r\nSi tiene alguna consulta me indica para poder conversarlo.',NULL,'VENTAS','Completado',1),(130,'2025-10-25 10:11:50','HERVIN','GER_02','GERENCIA','','Buenos dias estimada Evelyn,\r\nsolicito diseño de tarjetas para colocar en el correo. las etiquetas son las siguentes ,\r\nGERENTE GENERAL - hcoronel@businesszeus.com\r\nAREA DE IMPORTACIONES- import@businesszeus.com\r\nADMINISTRACION -  hcoronel.administracion@businesszeus.com\r\nMe envia 3 pre diseños  para la seleccion .\r\na la espera de su pronta respuesta .',NULL,'MARKETING','Completado',1),(132,'2025-10-28 17:06:25','KIMBERLY','ADMIN_07','ADMINISTRACION','','Buenas tardes estimado Joseph se solicita la muestras de los nuevos modelos que ingresaron para poder ofrecer en Malvinas para el día 30 de octubre:\r\nThermo Plus\r\nNitron abierto\r\nNitron cerrado',NULL,'LOGISTICA','Completado',1),(141,'2025-11-03 10:45:30','EVELYN','MK_07','MARKETING','','Buenos días , por favor se solicita muestras de los siguientes productos:\r\nGuantes Flexiblue Azul \r\nUltraflex \r\nGuantes Thermo - Plus Celeste \r\nNitron abierto y Nitro cerrado \r\nSe solicita para el área de marketing para las fotos correspondientes. Por favor se necesita lo más antes posible. Gracias',NULL,'LOGISTICA','En Proceso',1),(143,'2025-11-03 10:49:29','EVELYN','MK_08','MARKETING','','Buenos dias Srta kimberly , por favor se solicita los precios de los nuevos productos que ingresaron:\r\nGuantes Flexiblue Azul \r\nGuantes Thermo - Plus Celeste \r\nNitron abierto \r\nNitron cerrado \r\n\r\nQuedo a la espera de su respuesta . gracias ',NULL,'ADMINISTRACION','Pendiente',1);
