DROP TABLE IF EXISTS `ventas`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `ventas` (
  `ID_VENTA` int NOT NULL AUTO_INCREMENT,
  `ID_CLIENTE` int DEFAULT NULL,
  `FECHA` date DEFAULT NULL,
  `CLASIFICACION` varchar(20) DEFAULT NULL,
  `ASESOR` varchar(15) DEFAULT NULL,
  `N_COMPROBANTE` varchar(10) NOT NULL,
  `ID_REGION` varchar(10) DEFAULT NULL,
  `ID_DISTRITO` varchar(10) DEFAULT NULL,
  `ID_LUGAR` varchar(20) DEFAULT NULL,
  `SALIDA_DE_PEDIDO` varchar(20) DEFAULT NULL,
  `OBSERVACIONES` text,
  `ESTADO` char(1) DEFAULT '1',
  `FECHA_REGISTRO` timestamp NULL DEFAULT ((now() - interval 5 hour)),
  PRIMARY KEY (`ID_VENTA`),
  UNIQUE KEY `N_COMPROBANTE` (`N_COMPROBANTE`),
  KEY `llave_regiones` (`ID_REGION`),
  KEY `llave_lugar` (`ID_LUGAR`),
  KEY `llave_ventas` (`ID_CLIENTE`)
) ENGINE=InnoDB AUTO_INCREMENT=3463 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
